import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Star, Quote, ChevronLeft, ChevronRight, TrendingUp, Phone, MapPin } from 'lucide-react';

const ClientResults = () => {
  const [currentTestimonial, setCurrentTestimonial] = useState(0);

  const testimonials = [
    {
      name: "Mike Johnson",
      business: "Johnson Plumbing Co.",
      image: "https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?w=150&h=150&fit=crop&crop=face",
      quote: "Rankly360 got us to #1 in Google Maps in just 45 days. Our call volume increased by 180% and we're now turning away work because we're so busy!",
      results: {
        ranking: "Top 3 in 30 days",
        calls: "+180% calls",
        revenue: "+$45K monthly"
      },
      beforeAfter: {
        before: "Position 12",
        after: "Position 1"
      }
    },
    {
      name: "Sarah Chen",
      business: "Chen Dental Clinic",
      image: "https://images.unsplash.com/photo-1559839734-2b71ea197ec2?w=150&h=150&fit=crop&crop=face",
      quote: "The map embed stacking strategy was incredible. We went from invisible to dominating our local market. Our patient bookings are up 220%!",
      results: {
        ranking: "Top 3 in 45 days",
        calls: "+220% bookings",
        revenue: "+$68K monthly"
      },
      beforeAfter: {
        before: "Position 8",
        after: "Position 1"
      }
    },
    {
      name: "David Rodriguez",
      business: "Rodriguez Auto Repair",
      image: "https://images.unsplash.com/photo-1472099645785-5658abf4ff4e?w=150&h=150&fit=crop&crop=face",
      quote: "I was skeptical at first, but the results speak for themselves. We're now the first auto shop people see when they search locally. Business has never been better.",
      results: {
        ranking: "Top 3 in 60 days",
        calls: "+150% calls",
        revenue: "+$32K monthly"
      },
      beforeAfter: {
        before: "Position 15",
        after: "Position 2"
      }
    },
    {
      name: "Lisa Thompson",
      business: "Thompson Law Firm",
      image: "https://images.unsplash.com/photo-1494790108755-2616b612b786?w=150&h=150&fit=crop&crop=face",
      quote: "The GBP optimization and review management transformed our local presence. We're now getting qualified leads daily instead of weekly.",
      results: {
        ranking: "Top 3 in 40 days",
        calls: "+190% leads",
        revenue: "+$55K monthly"
      },
      beforeAfter: {
        before: "Position 6",
        after: "Position 1"
      }
    }
  ];

  const nextTestimonial = () => {
    setCurrentTestimonial((prev) => (prev + 1) % testimonials.length);
  };

  const prevTestimonial = () => {
    setCurrentTestimonial((prev) => (prev - 1 + testimonials.length) % testimonials.length);
  };

  return (
    <section className="py-20 bg-white">
      {/* Before & After Comparison */}
      <div className="max-w-5xl mx-auto px-4 mb-16">
        <h2 className="text-4xl md:text-5xl font-bold text-primary-900 text-center mb-4">Before & After: Real Local SEO Results</h2>
        <p className="text-lg text-gray-600 text-center mb-10 max-w-2xl mx-auto">
